import React, { useState } from 'react';

let currentTime = '0:0:00';

const Timer = () => {
    return(
        <>
            <h1 className="heading"> {currentTime} </h1>
            <button> Get Time </button>
        </>
    );

}



const Button = () => {
    return(
        <Timer />
    );
}

export default Button;
